import React from 'react'
// import './Home.css'

function Home() {
    return (
        <div className='home'>
            <h1>Home Component</h1>
            <div className="home_container">
                <img src="https://eloutput.com/app/uploads-eloutput.com/2020/06/Watch-Party-Amazon-Prime-Video.jpg"/>
                <img src="http://images-eu.ssl-images-amazon.com/images/G/02/digital/video"/>
               
                </div>

            
        </div>
    )
}

export default Home
